```json
{
  "application": "SLURM",
  "details": {
    "resources": {
      "cores": 1,
      "nodes": 1,
      "runtime": "600 minutes (10 hours)",
      "partition": "seas_gpu",
      "gpu": 1,
      "memory": "80000 MB"
    },
    "environment": {
      "conda_environment": "itai_ml_env",
      "python_version": "3"
    },
    "script": {
      "name": "quantizer_job.py",
      "arguments": "--path ../results/ishapira_resnet18_CIFAR-10_l2_0.04388_2023-12-01_13-16-19 --bit_width 8"
    },
    "logs": {
      "stdout": "/n/home12/ishapira/git_connection/TinyML-RegulizationAndQuantization/jobs/slurm_logs/quant_ishapira_resnet18_CIFAR-10_l2_0.04388_2023-12-01_13-16-19_8_%j.out",
      "stderr": "/n/home12/ishapira/git_connection/TinyML-RegulizationAndQuantization/jobs/slurm_logs/quant_ishapira_resnet18_CIFAR-10_l2_0.04388_2023-12-01_13-16-19_8_%j.err"
    },
    "gpu_info_log": "/n/home12/ishapira/git_connection/TinyML-RegulizationAndQuantization/jobs/gpu.txt"
  }
}
```

**Explanation:**

* **SLURM** is a job scheduler used for running tasks on high-performance computing clusters. This script utilizes SLURM to allocate resources for the task.
* **Resources:** The script requests 1 core, 1 node, 1 GPU, 80000 MB memory, and runs on the "seas_gpu" partition for 600 minutes (10 hours).
* **Environment:** The script uses the Conda environment named "itai_ml_env" and executes the Python script "quantizer_job.py" with the given arguments.
* **Logs:** Standard output and error are redirected to separate files in the "slurm_logs" directory.
* **GPU Info:** The script saves GPU information to a file named "gpu.txt".
